    false,nt"url": null,nt"notes": "This annual narrative report for Wertheim
    National Wildlife Refuge outlines Refuge accomplishments during the 1970 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, mammals, raptors,
    fish, and diseases- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    fur harvesting and commercial fishing. The public relations section of the report
    describes Refuge visitors and hunting. Items of interest, N-R forms, and photographs
    are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
